import React from 'react'
import Navbar from '../Navbar/Navbar';
import './Manga.css';
function Manga(){
    return(
        <div className='manga'>
            <Navbar />
            <h1>Welcome to my website!</h1>
        </div>
    )
}

export default Manga;
